import React, { useState } from "react";
import axios from "axios";

const RepairForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    deviceType: "",
    damageType: "",
    description: ""
  });

  // Handle input changes
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  // Handle form submit
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/api/repairs", formData);
      alert("Repair request submitted successfully ✅");
      setFormData({
        name: "",
        email: "",
        phone: "",
        deviceType: "",
        damageType: "",
        description: ""
      });
    } catch (error) {
      console.error("Error submitting repair request:", error);
      alert("Failed to submit repair request ❌");
    }
  };

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100">
      <form
        onSubmit={handleSubmit}
        className="bg-white shadow-lg rounded-2xl p-8 w-full max-w-lg"
      >
        <h2 className="text-2xl font-bold text-center text-gray-800 mb-6">
          Submit Repair Request
        </h2>

        {/* Customer Info */}
        <div className="mb-4">
          <label className="block text-gray-700 font-medium">Name</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 mt-2 border rounded-lg focus:ring focus:ring-blue-400"
            placeholder="Enter your name"
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 font-medium">Email</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 mt-2 border rounded-lg focus:ring focus:ring-blue-400"
            placeholder="Enter your email"
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 font-medium">Phone</label>
          <input
            type="text"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 mt-2 border rounded-lg focus:ring focus:ring-blue-400"
            placeholder="Enter your phone number"
          />
        </div>

        {/* Repair Info */}
        <div className="mb-4">
          <label className="block text-gray-700 font-medium">Device Type</label>
          <input
            type="text"
            name="deviceType"
            value={formData.deviceType}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 mt-2 border rounded-lg focus:ring focus:ring-blue-400"
            placeholder="Laptop / Mobile / Tablet"
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 font-medium">Damage Type</label>
          <input
            type="text"
            name="damageType"
            value={formData.damageType}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 mt-2 border rounded-lg focus:ring focus:ring-blue-400"
            placeholder="Screen / Battery / Software"
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 font-medium">Description</label>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 mt-2 border rounded-lg focus:ring focus:ring-blue-400"
            placeholder="Describe the issue..."
            rows="3"
          ></textarea>
        </div>

        <button
          type="submit"
          className="w-full bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700 transition"
        >
          Submit Request
        </button>
      </form>
    </div>
  );
};

export default RepairForm;
